import React from 'react'
import {useState} from "react";
import {motion, AnimatePresence} from "framer-motion";
import PropTypes from 'prop-types'
import './f-qs-section.css'


const Accordion = ({i, expanded, setExpanded}) => {
    const isOpen = i === expanded;

    // By using `AnimatePresence` to mount and unmount the contents, we can animate
    // them in and out while also only rendering the contents of open accordions
    return (
        <>
            {/*<motion.header*/}
            {/*    initial={false}*/}
            {/*    animate={{backgroundColor: isOpen ? "#FF0088" : "#0055FF"}}*/}
            {/*    onClick={() => setExpanded(isOpen ? false : i)}*/}
            {/*/>*/}
            <AnimatePresence initial={false}>
                {isOpen && (
                    <motion.section
                        key="content"
                        initial="collapsed"
                        animate="open"
                        exit="collapsed"
                        variants={{
                            open: {opacity: 1, height: "auto"},
                            collapsed: {opacity: 0, height: 0}
                        }}
                        transition={{duration: 0.8, ease: [0.04, 0.62, 0.23, 0.98]}}
                    >
                        <div>yoyoyo</div>
                    </motion.section>
                )}
            </AnimatePresence>
        </>
    );
};

export const FAQsSection = () => {
    // This approach is if you only want max one section open at a time. If you want multiple
    // sections to potentially be open simultaneously, they can all be given their own `useState`.
    const [expanded, setExpanded] = useState<false | number>(0);

    return (
        <>
            <section className={`faqs-container`}>
                <div className={`faqs-content`}>
                    <h2>Learn more about Decentraland</h2>
                    <h1>Frequently Asked Questions</h1>
                    <motion.div
                        initial={false}
                        animate={{ backgroundColor: isOpen ? "#FF0088" : "#0055FF" }}
                        onClick={() => setExpanded(isOpen ? false : i)}>
                        <h3>What is <span>Metaverse?</span></h3>
                        <svg width="72" height="72" viewBox="0 0 72 72" fill="none" xmlns="http://www.w3.org/2000/svg">
                            <circle opacity="0.2" cx="36" cy="36" r="35" stroke="white" strokeWidth="2"/>
                            <g clipPath="url(#clip0_529_3930)">
                                <path
                                    d="M45 33.0022L42.885 30.8872L36 37.7572L29.115 30.8872L27 33.0022L36 42.0022L45 33.0022Z"
                                    fill="white"/>
                            </g>
                            <defs>
                                <clipPath id="clip0_529_3930">
                                    <rect width="36" height="36" fill="white" transform="translate(54 18) rotate(90)"/>
                                </clipPath>
                            </defs>
                        </svg>
                    </motion.div>
                    <AnimatePresence initial={false}>
                        {isOpen && (
                            <motion.section
                                key="content"
                                initial="collapsed"
                                animate="open"
                                exit="collapsed"
                                variants={{
                                    open: {opacity: 1, height: "auto"},
                                    collapsed: {opacity: 0, height: 0}
                                }}
                                transition={{duration: 0.8, ease: [0.04, 0.62, 0.23, 0.98]}}
                            >
                                <div>yoyoyo</div>
                            </motion.section>
                        )}
                    </AnimatePresence>
                    <div>
                        <h3>What is <span>DAO?</span></h3>
                        <svg width="72" height="72" viewBox="0 0 72 72" fill="none" xmlns="http://www.w3.org/2000/svg">
                            <circle opacity="0.2" cx="36" cy="36" r="35" stroke="white" strokeWidth="2"/>
                            <g clipPath="url(#clip0_529_3930)">
                                <path
                                    d="M45 33.0022L42.885 30.8872L36 37.7572L29.115 30.8872L27 33.0022L36 42.0022L45 33.0022Z"
                                    fill="white"/>
                            </g>
                            <defs>
                                <clipPath id="clip0_529_3930">
                                    <rect width="36" height="36" fill="white" transform="translate(54 18) rotate(90)"/>
                                </clipPath>
                            </defs>
                        </svg>
                    </div>
                    <div>
                        <h3>What is <span>DCL’s economy?</span></h3>
                        <svg width="72" height="72" viewBox="0 0 72 72" fill="none" xmlns="http://www.w3.org/2000/svg">
                            <circle opacity="0.2" cx="36" cy="36" r="35" stroke="white" strokeWidth="2"/>
                            <g clipPath="url(#clip0_529_3930)">
                                <path
                                    d="M45 33.0022L42.885 30.8872L36 37.7572L29.115 30.8872L27 33.0022L36 42.0022L45 33.0022Z"
                                    fill="white"/>
                            </g>
                            <defs>
                                <clipPath id="clip0_529_3930">
                                    <rect width="36" height="36" fill="white" transform="translate(54 18) rotate(90)"/>
                                </clipPath>
                            </defs>
                        </svg>
                    </div>
